ny resource connected to the Internet or a private network. It associates various information with domain names assigned to each of the participating entities. Most prominently, it translates more readily memorized domain names to the numerical IP addresses needed for the purpose of locating and identifying computer services and devices with the underlying network protocols. By providing a worldwide, distributed directory service, the Domain Name System is an essential component of the functionality of the Internet.\"},{\"lang\":\"fr\",\"value\":\"Le Domain Name System (ou DNS, système de noms de domaine) est un service permettant de traduire un nom de domaine en informations de plusieurs types qui y sont associées, notamment en adresses IP de la machine portant ce nom.\"}]},\"commands\":[{\"name\":\"App-Protocol-DNS-Request\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::dns::plugin --mode=request --search=\\\\\'$_SERVICESEARCH$\\\\\' --warning=\\\\\'$_SERVICEWARNING$\\\\\' --critical=\\\\\'$_SERVICECRITICAL$\\\\\' $_SERVICEEXTRAOPTIONS$\\\\\\\"\"}],\"service_templates\":[{\"name\":\"App-Protocol-DNS-Request-Custom\",\"alias\":\"DNS-Request\",\"parent_template\":\"App-Protocol-DNS-Request\",\"_comment\":\"{FR: ContrÃ´le des requÃªtes vers un serveur DNS.}\\n\\n{EN: Check requests to a DNS server.}\",\"macros\":[],\"discovery_list_mode\":\"\",\"icon\":\"\"},{\"name\":\"App-Protocol-DNS-Request\",\"alias\":\"DNS-Request\",\"parent_template\":\"generic-active-service\",\"_comment\":\"{FR: ContrÃ´le des requÃªtes vers un serveur DNS.}\\n\\n{EN: Check requests to a DNS server.}\",\"macros\":[{\"key\":\"$_SERVICECRITICAL$\",\"value\":\"\",\"password\":false,\"description\":\"\"},{\"key\":\"$_SERVICEEXTRAOPTIONS$\",\"value\":\"\",\"password\":false,\"description\":\"\"},{\"key\":\"$_SERVICESEARCH$\",\"value\":\"google.com\",\"password\":false,\"description\":\"\"},{\"key\":\"$_SERVICEWARNING$\",\"value\":\"\",\"password\":false,\"descrip