a client and server on a computer network.\\r\\n\\r\\nFTP is built on a client-server model architecture and uses separate control and data connections between the client and the server.[1] FTP users may authenticate themselves with a clear-text sign-in protocol, normally in the form of a username and password, but can connect anonymously if the server is configured to allow it. For secure transmission that protects the username and password, and encrypts the content, FTP is often secured with SSL/TLS (FTPS). SSH File Transfer Protocol (SFTP) is sometimes also used instead, but is technologically different.\"},{\"lang\":\"fr\",\"value\":\"File Transfer Protocol (protocole de transfert de fichiers), ou FTP, est un protocole de communication destiné à l\\\\\'échange informatique de fichiers sur un réseau TCP/IP. Il permet, depuis un ordinateur, de copier des fichiers vers un autre ordinateur du réseau, ou encore de supprimer ou de modifier des fichiers sur cet ordinateur. Ce mécanisme de copie est souvent utilisé pour alimenter un site web hébergé chez un tiers.\"}]},\"commands\":[{\"name\":\"App-Protocol-FTP-Commands\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::ftp::plugin --mode commands --hostname=$HOSTADDRESS$ $_HOSTFTPEXTRAOPTIONS$ --username=\\\\\'$_HOSTFTPUSERNAME$\\\\\' --password=\\\\\'$_HOSTFTPPASSWORD$\\\\\' --warning=\\\\\'$_SERVICEWARNING$\\\\\' --critical=\\\\\'$_SERVICECRITICAL$\\\\\' --ftp-command=\\\\\'$_SERVICEFTPCOMMAND$\\\\\' $_SERVICEEXTRAOPTIONS$\\\\\\\"\"},{\"name\":\"App-Protocol-FTP-Date\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::ftp::plugin --mode=date --hostname=$HOSTADDRESS$ $_HOSTFTPEXTRAOPTIONS$ --username=\\\\\'$_HOSTFTPUSERNAME$\\\\\' --password=\\\\\'$_HOSTFTPPASSWORD$\\\\\' --warning=\\\\\'$_SERVICEWARNING$\\\\\' --critical=\\\\\'$_SERVICECRITICAL$\\\\\' --directory=\\\\\'$_SERVICEDIRECTORY$\\\\\' $_SERVICEEXTRAOPTIONS$\\\\\\\"\"},{\"name\":\"App-Protocol-FT