it aujourd\\\\\'hui un protocole permettant également de récupérer les messages localement.\"}]},\"commands\":[{\"name\":\"App-Protocol-IMAP-Login\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::imap::plugin --mode=login --hostname=$HOSTADDRESS$ --username=\\\\\'$_HOSTIMAPUSERNAME$\\\\\' --password=\\\\\'$_HOSTIMAPPASSWORD$\\\\\' $_HOSTIMAPEXTRAOPTIONS$ --warning=\\\\\'$_SERVICEWARNING$\\\\\'  --critical=\\\\\'$_SERVICECRITICAL$\\\\\' $_SERVICEEXTRAOPTIONS$\\\\\\\"\"},{\"name\":\"App-Protocol-IMAP-Search-Message\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::imap::plugin --mode=search-message --hostname=$HOSTADDRESS$ --username=\\\\\'$_HOSTIMAPUSERNAME$\\\\\' --password=\\\\\'$_HOSTIMAPPASSWORD$\\\\\' $_HOSTIMAPEXTRAOPTIONS$ --warning=\\\\\'$_SERVICEWARNING$\\\\\'  --critical=\\\\\'$_SERVICECRITICAL$\\\\\' --search=\\\\\'$_SERVICESEARCHFILTER$\\\\\' $_SERVICEEXTRAOPTIONS$\\\\\\\"\"}],\"service_templates\":[{\"name\":\"App-Protocol-IMAP-Login-Custom\",\"alias\":\"IMAP-Login\",\"parent_template\":\"App-Protocol-IMAP-Login\",\"_comment\":\"\",\"macros\":[],\"discovery_list_mode\":\"\",\"icon\":\"\"},{\"name\":\"App-Protocol-IMAP-Login\",\"alias\":\"IMAP-Login\",\"parent_template\":\"generic-active-service\",\"_comment\":\"{FR: ContrÃ´le permettant de vÃ©rifier la connexion d\'un utilisateur IMAP.}\\n\\n{EN: Check user connection to an IMAP server.}\",\"macros\":[{\"key\":\"$_SERVICECRITICAL$\",\"value\":\"\",\"password\":false,\"description\":\"\"},{\"key\":\"$_SERVICEEXTRAOPTIONS$\",\"value\":\"\",\"password\":false,\"description\":\"\"},{\"key\":\"$_SERVICEWARNING$\",\"value\":\"\",\"password\":false,\"description\":\"\"}],\"command_name\":\"App-Protocol-IMAP-Login\",\"discovery_list_mode\":\"\",\"icon\":\"\"},{\"name\":\"generic-active-service\",\"alias\":\"generic-active-service\",\"parent_template\":\"\",\"_comment\":\"\",\"macros\":[],\"discovery_list_mode\":\"\",\"icon\":\"\"},{\"name\":\"Bas