odèle de réplication. C\\\\\'est une structure arborescente dont chacun des nœuds est constitué d\\\\\'attributs associés à leurs valeurs. LDAP est moins complexe que le modèle X.500 édicté par l\\\\\'UIT-T.\"}]},\"commands\":[{\"name\":\"App-Protocol-LDAP-Login\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::ldap::plugin --mode=login --hostname=$HOSTADDRESS$ --username=\\\\\'$_HOSTLDAPUSERNAME$\\\\\' --password=\\\\\'$_HOSTLDAPPASSWORD$\\\\\' $_HOSTLDAPEXTRAOPTIONS$ --warning=\\\\\'$_SERVICEWARNING$\\\\\'  --critical=\\\\\'$_SERVICECRITICAL$\\\\\' $_SERVICEEXTRAOPTIONS$\\\\\\\"\"},{\"name\":\"App-Protocol-LDAP-Search\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::ldap::plugin --mode=search --hostname=$HOSTADDRESS$ --username=\\\\\'$_HOSTLDAPUSERNAME$\\\\\' --password=\\\\\'$_HOSTLDAPPASSWORD$\\\\\' $_HOSTLDAPEXTRAOPTIONS$ --search-base=\\\\\'$_SERVICESEARCHBASE$\\\\\' --search-filter=\\\\\'$_SERVICESEARCHFILTER$\\\\\' --warning=\\\\\'$_SERVICEWARNING$\\\\\'  --critical=\\\\\'$_SERVICECRITICAL$\\\\\' $_SERVICEEXTRAOPTIONS$\\\\\\\"\"}],\"service_templates\":[{\"name\":\"App-Protocol-LDAP-Login-Custom\",\"alias\":\"LDAP-Login\",\"parent_template\":\"App-Protocol-LDAP-Login\",\"_comment\":\"\",\"macros\":[],\"discovery_list_mode\":\"\",\"icon\":\"\"},{\"name\":\"App-Protocol-LDAP-Login\",\"alias\":\"LDAP-Login\",\"parent_template\":\"generic-active-service\",\"_comment\":\"{FR: ContrÃ´le un accÃ¨s vers un serveur LDAP.}\\n\\n{EN: Check login to a LDAP server.}\",\"macros\":[{\"key\":\"$_SERVICECRITICAL$\",\"value\":\"\",\"password\":false,\"description\":\"\"},{\"key\":\"$_SERVICEEXTRAOPTIONS$\",\"value\":\"\",\"password\":false,\"description\":\"\"},{\"key\":\"$_SERVICEWARNING$\",\"value\":\"\",\"password\":false,\"description\":\"\"}],\"command_name\":\"App-Protocol-LDAP-Login\",\"discovery_list_mode\":\"\",\"icon\":\"\"},{\"name\":\"generic-active-service\",\"alias\":\"generic-active-service\",\"