col-smtp\",\"name\":\"applications-protocol-smtp\",\"icon\":\"\",\"version\":\"2.0.1\",\"update_date\":\"1459948318\",\"status\":\"stable\",\"status_message\":\"Generation for export\",\"tags\":[\"email\",\"network\",\"protocol\",\"smtp\",\"ssmtp\"],\"author\":\"Centreon\",\"email\":\"contact@centreon.com\",\"website\":\"www.centreon.com\",\"changelog\":\"N/A\",\"description\":[{\"lang\":\"en\",\"value\":\"Simple Mail Transfer Protocol (SMTP) is an Internet standard for electronic mail (email) transmission. First defined by RFC 821 in 1982, it was last updated in 2008 with the Extended SMTP additions by RFC 5321—which is the protocol in widespread use today.\\r\\nSMTP by default uses TCP port 25. The protocol for mail submission is the same, but uses port 587. SMTP connections secured by SSL, known as SMTPS, default to port 465 (nonstandard, but sometimes used for legacy reasons).\"},{\"lang\":\"fr\",\"value\":\"Simple Mail Transfer Protocol (SMTP, littéralement « protocole simple de transfert de courrier ») est un protocole de communication utilisé pour transférer le courrier électronique (courriel) vers les serveurs de messagerie électronique.\\r\\nSMTP est un protocole assez simple (comme son nom l\\\\\'indique). On commence par spécifier l\\\\\'expéditeur du message, puis le ou les destinataires d\\\\\'un message, puis, en général après avoir vérifié leur existence, le corps du message est transféré. Il est possible de tester un serveur SMTP en utilisant la commande telnet sur le port 25 d\\\\\'un serveur distant.\"}]},\"commands\":[{\"name\":\"App-Protocol-SMTP-Login\",\"line\":\"\\\\\\\"$USER1$\\\\\\\\/centreon_plugins.pl --plugin=apps::protocols::smtp::plugin --mode=login --hostname=$HOSTADDRESS$ --username=\\\\\'$_HOSTSMTPUSERNAME$\\\\\' --password=\\\\\'$_HOSTSMTPPASSWORD$\\\\\' $_HOSTSMTPEXTRAOPTIONS$ --warning=\\\\\'$_SERVICEWARNING$\\\\\'  --critical=\\\\\'$_SERVICECRITICAL$\\\\\' $_SERVICEEXTRAOPTIONS$\\\\\\\"\"},{\"name\":\"App-Protocol-SMTP-Message\",