acros\":[{\"key\":\"$_SERVICECOMPONENT$\",\"value\":\"psu\",\"password\":false,\"description\":\"\"},{\"key\":\"$_SERVICEEXTRAOPTIONS$\",\"value\":\"--verbose\",\"password\":false,\"description\":\"\"}],\"command_name\":\"HW-Hp-Server-SNMP-Hardware\",\"discovery_list_mode\":\"\",\"icon\":\"\"},{\"name\":\"HW-Hp-Server-Hardware-Psu-SNMP-Custom\",\"alias\":\"Hardware-Psu\",\"parent_template\":\"HW-Hp-Server-Hardware-Psu-SNMP\",\"_comment\":\"\",\"macros\":[],\"discovery_list_mode\":\"\",\"icon\":\"\"},{\"name\":\"HW-Hp-Server-Hardware-Storage-SNMP\",\"alias\":\"Hardware-Storage\",\"parent_template\":\"generic-active-service\",\"_comment\":\"{FR: ContrÃ´le le stockage.}\\n\\n{EN: Check storage hardware.}\",\"macros\":[{\"key\":\"$_SERVICECOMPONENT$\",\"value\":\"storage\",\"password\":false,\"description\":\"\"},{\"key\":\"$_SERVICEEXTRAOPTIONS$\",\"value\":\"--verbose\",\"password\":false,\"description\":\"\"}],\"command_name\":\"HW-Hp-Server-SNMP-Hardware\",\"discovery_list_mode\":\"\",\"icon\":\"\"},{\"name\":\"HW-Hp-Server-Hardware-Storage-SNMP-Custom\",\"alias\":\"Hardware-Storage\",\"parent_template\":\"HW-Hp-Server-Hardware-Storage-SNMP\",\"_comment\":\"\",\"macros\":[],\"discovery_list_mode\":\"\",\"icon\":\"\"},{\"name\":\"HW-Hp-Server-Hardware-Temperature-SNMP\",\"alias\":\"Hardware-Temperature\",\"parent_template\":\"generic-active-service\",\"_comment\":\"{FR: ContrÃ´le les tempÃ©ratures matÃ©riel.}\\n\\n{EN: Check hardware temperatures.}\",\"macros\":[{\"key\":\"$_SERVICECOMPONENT$\",\"value\":\"temperature\",\"password\":false,\"description\":\"\"},{\"key\":\"$_SERVICEEXTRAOPTIONS$\",\"value\":\"--verbose\",\"password\":false,\"description\":\"\"}],\"command_name\":\"HW-Hp-Server-SNMP-Hardware\",\"discovery_list_mode\":\"\",\"icon\":\"\"},{\"name\":\"HW-Hp-Server-Hardware-Temperature-SNMP-Custom\",\"alias\":\"Hardware-Temperature\",\"parent_template\":\"HW-Hp-Server-Hardware-Temperature-SNMP\",\"_comment\":\"\",\"macros\":[],\"discovery_list_mode\":\"\",\"icon\":\"\"}],\"host_templates\":[{\"name\":\"HW-Server-Hp-Server-SNMP\",\"parent_template\":\"generic-active-host\",\"alias\":\"Template to check HP server through HP Insight Management agent using SNMP protocol\",\"macros\":[{\"key\":\"$_HOSTSNMPEXTRAOPTIONS$\",\"value\":\"\"}],\"services\":[\"HW-Hp-Server-Hardware-Global-SNMP-Custom\"],\"icon\":\"\",\"discovery_validator\":\"\"},{\"name\":\"generic-active-host\",\"parent_template\":\"\",\"alias\":\"generic-active-host\",\"macros\":[],\"services\":[\"Base-Ping-LAN-custom\"],\"icon\":\"\",\"discovery_validator\":\"\"}],\"images\":[]}','N/A',NULL);
INSERT INTO `pluginpack_description` VALUES (26,'2.1.2','en','Microsoft BizTalk Server (or simply \\\"BizTalk\\\") enables companies to automate business processes, through the use of adapters which are tailored to communicate with different software systems used in an enterprise. Created by Microsoft, it provides enterprise application integration, business process automation, business-to-business communication, message broker and business activity monitoring.'),(26,'2.1.2','fr','Microsoft BizTalk Server, ou plus simplement \\\"BizTalk\\\", est un serveur de gestion des processus métiers (Business Process Management). À travers l\\\'utilisation d\\\'adaptateurs conçus pour communiquer avec les différents systèmes logiciels utilisés par les grandes entreprises, Biztalk permet à celles-ci d\\\'intégrer et d\\\'automatiser leurs processus métiers.'),(27,'1.0.1','en','IBM Informix is a product family within IBM\\\'s Information Management division that is centered on several relational database management system (RDBMS) offerings. The Informix products were originally developed by Informix Corporation, whose Informix Software subsidiary was acquired by IBM in 2001.'),(27,'1.0.1','fr','Informix est une combinaison de base de données relationnelle et de base de données orientée objet. Cette solution a été créée par Informix Software. En 2001, cette société a été achetée par IBM. Le nom complet du produit devient alors IBM Informix Dynamic Server.'),(28,'2.1.3','en','Microsoft SQL Server is a relational database management system developed by Microsoft. As a database server, it is a software product with the primary function of storing and retrieving data as requested by other software applications which may run either on the same computer or on another computer across a network (including the Internet).'),(28,'2.1.3','fr','Microsoft SQL Server est un système de gestion de base de données (abrégé en SGBD) incorporant entre autres un SGBDR (SGBD relationnel ») développé et commercialisé par la société Microsoft. Il ne fonctionne que sous les OS Windows.'),(29,'2.1.1','en','MySQL is an open-source relational database management system (RDBMS);'),(29,'2.1.1','fr','MySQL est un système de gestion de bases de données relationnelles (SGBDR). Il est distribué sous une double licence GPL et propriétaire.'),(30,'2.3.1','en','Oracle Database (commonly referred to as Oracle RDBMS or simply as Oracle) is an object-relational database management system[3] produced and marketed by Oracle Corporation.'),(30,'2.3.1','fr','Oracle Database est un système de gestion de base de données relationnelle (SGBDR) qui depuis l\\\'introduction du support du modèle objet dans sa version 8 peut être aussi qualifié de système de gestion de base de données relationnel-objet (SGBDRO).'),(31,'1.0.1','en','PostgreSQL, often simply Postgres, is an object-relational database management system (ORDBMS) with an emphasis on extensibility and standards-compliance. As a database server, its primary function is to store data securely, supporting best practices, and to allow for retrieval at the request of other software applications. It can handle workloads ranging from small single-machine applications to large Internet-facing applications with many concurrent users.'),(31,'1.0.1','fr','PostgreSQL est un système de gestion de base de données relationnelle et objet (SGBDRO). C\\\'est un outil libre disponible selon les termes d\\\'une licence de type BSD.'),(32,'2.0.1','en','Elasticsearch is a search server based on Lucene. It provides a distributed, multitenant-capable full-text search engine with an HTTP web interface and schema-free JSON documents. Elasticsearch is developed in Java and is released as open source under the terms of the Apache License. Elasticsearch is the most popular enterprise search engine followed by Apache Solr, also based on Lucene.'),(32,'2.0.1','fr','Elasticsearch est un serveur utilisant Lucene pour l\\\'indexation et la recherche des données. Il fournit un moteur de recherche distribué et multi-entité à travers une interface REST. C\\\'est un logiciel libre écrit en Java et publié en open source sous licence Apache.\r\nElasticsearch est le serveur de recherche d\\\'entreprise le plus populaire, suivi par Apache Solr qui utilise aussi Lucene. Il est associé à deux autres produits libres, Kibana (en) et Logstash, qui sont respectivement un visualiseur de données et un ETL (initialement destiné aux logs).'),(33,'2.0.1','en','desc'),(33,'2.0.1','fr','BlueMind est une suite logicielle libre de messagerie d’entreprise, d’agendas et de travail collaboratif utilisant JavaScript et HTML5.'),(39,'1.5.1','en','Border Gateway Protocol (BGP) is a standardized exterior gateway protocol designed to exchange routing and reachability information among autonomous systems (AS) on the Internet.'),(39,'1.5.1','fr','Border Gateway Protocol (BGP) est un protocole d\\\'échange de route utilisé notamment sur le réseau Internet. Son objectif est d\\\'échanger des informations de routage et d\\\'accessibilité de réseaux (appelés préfixes) entre Autonomous Systems (AS).'),(40,'1.3.3','en','Originally rooted in making Nagios easier to use and manage, Centreon has since come a long way.  Keeping the best of open source, Centreon is a full-fledged industry-strength solution that meets the needs of the most demanding IT management teams.\r\n\r\nWhether you need a comprehensive or partial solution for your network, server, application or service performance monitoring needs, Centreon makes it easy to test, adopt, extend and scale.  Find out why our customers use Centreon and browse the many advantages of Centreon’s software products and features.'),(40,'1.3.3','fr','Centreon est un progiciel Open Source et gratuit qui vous permet de superviser l’ensemble de vos infrastructures et applications composant votre système d’information.\r\n\r\nGrâce à ses composants techniques et fonctionnels pertinents Centreon vous offre toutes les fonctionnalités indispensables à une supervision professionnelle complète. Il répond aux besoins des Directions des Systèmes d’Informations (DSI) les plus exigeantes tout en apportant la flexibilité liée à l’Open Source.'),(41,'2.0.1','en','The Domain Name System (DNS) is a hierarchical decentralized naming system for computers, services, or any resource connected to the Internet or a private network. It associates various information with domain names assigned to each of the participating entities. Most prominently, it translates more readily memorized domain names to the numerical IP addresses needed for the purpose of locating and identifying computer services and devices with the underlying network protocols. By providing a worldwide, distributed directory service, the Domain Name System is an essential component of the functionality of the Internet.'),(41,'2.0.1','fr','Le Domain Name System (ou DNS, système de noms de domaine) est un service permettant de traduire un nom de domaine en informations de plusieurs types qui y sont associées, notamment en adresses IP de la machine portant ce nom.'),(42,'2.0.1','en','The File Transfer Protocol (FTP) is a standard network protocol used to transfer computer files between a client and server on a computer network.\r\n\r\nFTP is built on a client-server model architecture and uses separate control and data connections between the client and the server.[1] FTP users may authenticate themselves with a clear-text sign-in protocol, normally in the form of a username and password, but can connect anonymously if the server is configured to allow it. For secure transmission that protects the username and password, and encrypts the content, FTP is often secured with SSL/TLS (FTPS). SSH File Transfer Protocol (SFTP) is sometimes also used instead, but is technologically different.'),(42,'2.0.1','fr','File Transfer Protocol (protocole de transfert de fichiers), ou FTP, est un protocole de communication destiné à l\\\'échange informatique de fichiers sur un réseau TCP/IP. Il permet, depuis un ordinateur, de copier des fichiers vers un autre ordinateur du réseau, ou encore de supprimer ou de modifier des fichiers sur cet ordinateur. Ce mécanisme de copie est souvent utilisé pour alimenter un site web hébergé chez un tiers.'),(43,'2.3.1','en','Originally rooted in making Nagios easier to use and manage, Centreon has since come a long way.  Keeping the best of open source, Centreon is a full-fledged industry-strength solution that meets the needs of the most demanding IT management teams.\r\n\r\nWhether you need a comprehensive or partial solution for your network, server, application or service performance monitoring needs, Centreon makes it easy to test, adopt, extend and scale.  Find out why our customers use Centreon and browse the many advantages of Centreon’s software products and features.'),(43,'2.3.1','fr','Centreon est un progiciel Open Source et gratuit qui vous permet de superviser l’ensemble de vos infrastructures et applications composant votre système d’information.\r\n\r\nGrâce à ses composants techniques et fonctionnels pertinents Centreon vous offre toutes les fonctionnalités indispensables à une supervision professionnelle complète. Il répond aux besoins des Directions des Systèmes d’Informations (DSI) les plus exigeantes tout en apportant la flexibilité liée à l’Open Source.'),(44,'2.1.1','en','Originally rooted in making Nagios easier to use and manage, Centreon has since come a long way.  Keeping the best of open source, Centreon is a full-fledged industry-strength solution that meets the needs of the most demanding IT management teams.\r\n\r\nWhether you need a comprehensive or partial solution for your network, server, application or service performance monitoring needs, Centreon makes it easy to test, adopt, extend and scale.  Find out why our customers use Centreon and browse the many advantages of Centreon’s software products and features.'),(44,'2.1.1','fr','Centreon est un progiciel Open Source et gratuit qui vous permet de superviser l’ensemble de vos infrastructures et applications composant votre système d’information.\r\n\r\nGrâce à ses composants techniques et fonctionnels pertinents Centreon vous offre toutes les fonctionnalités indispensables à une supervision professionnelle complète. Il répond aux besoins des Directions des Systèmes d’Informations (DSI) les plus exigeantes tout en apportant la flexibilité liée à l’Open Source.'),(45,'2.1.1','en','The Hypertext Transfer Protocol (HTTP) is an application protocol for distributed, collaborative, hypermedia information systems. HTTP is the foundation of data communication for the World Wide Web.\r\nHypertext is structured text that uses logical links (hyperlinks) between nodes containing text. HTTP is the protocol to exchange or transfer hypertext.'),(45,'2.1.1','fr','L\\\'HyperText Transfer Protocol, plus connu sous l\\\'abréviation HTTP — littéralement « protocole de transfert hypertexte » — est un protocole de communication client-serveur développé pour le World Wide Web. HTTPS (avec S pour secured, soit « sécurisé ») est la variante du HTTP sécurisée par l\\\'usage des protocoles SSL ou TLS.'),(46,'2.0.1','en','In computing, the Internet Message Access Protocol (IMAP) is an Internet standard protocol used by e-mail clients to retrieve e-mail messages from a mail server over a TCP/IP connection. IMAP is defined by RFC 3501.\r\nIMAP was designed with the goal of permitting complete management of an email box by multiple email clients, therefore clients generally leave messages on the server until the user explicitly deletes them. An IMAP server typically listens on port number 143. IMAP over SSL (IMAPS) is assigned the port number 993.\r\n\r\nVirtually all modern e-mail clients and servers support IMAP. IMAP and the earlier POP3 (Post Office Protocol) are the two most prevalent standard protocols for email retrieval, with many webmail service providers such as Gmail, Outlook.com and Yahoo! Mail also providing support for either IMAP or POP3.'),(46,'2.0.1','fr','Au sens strict, Interactive Message Access Protocol devenu avec IMAP 4 Internet Message Access Protocol (IMAP) est un protocole qui permet d\\\'accéder à ses courriers électroniques directement sur les serveurs de messagerie. Son fonctionnement est donc à l\\\'opposé de POP qui, lui récupère les messages localement (depuis le poste de travail) via un logiciel spécialisé3. L\\\'évolution des différentes versions d\\\'IMAP (IMAP 4) en fait aujourd\\\'hui un protocole permettant également de récupérer les messages localement.'),(47,'1.0.3','en','The Lightweight Directory Access Protocol (LDAP; /??ldæp/) is an open, vendor-neutral, industry standard application protocol for accessing and maintaining distributed directory information services over an Internet Protocol (IP) network.[1] Directory services play an important role in developing intranet and Internet applications by allowing the sharing of information about users, systems, networks, services, and applications throughout the network.[2] As examples, directory services may provide any organized set of records, often with a hierarchical structure, such as a corporate email directory. Similarly, a telephone directory is a list of subscribers with an address and a phone number.'),(47,'1.0.3','fr','Lightweight Directory Access Protocol (LDAP) est à l\\\'origine un protocole permettant l\\\'interrogation et la modification des services d\\\'annuaire. Ce protocole repose sur TCP/IP. Il a cependant évolué pour représenter une norme pour les systèmes d\\\'annuaires, incluant un modèle de données, un modèle de nommage, un modèle fonctionnel basé sur le protocole LDAP, un modèle de sécurité et un modèle de réplication. C\\\'est une structure arborescente dont chacun des nœuds est constitué d\\\'attributs associés à leurs valeurs. LDAP est moins complexe que le modèle X.500 édicté par l\\\'UIT-T.'),(48,'1.0.3','en','Network Time Protocol (NTP) is a networking protocol for clock synchronization between computer systems over packet-switched, variable-latency data networks. In operation since before 1985, NTP is one of the oldest Internet protocols in current use. NTP was originally designed by David L. Mills of the University of Delaware, who still oversees its development.'),(48,'1.0.3','fr','Le Protocole d\\\'Heure Réseau (Network Time Protocol ou NTP) est un protocole qui permet de synchroniser, via un réseau informatique, l\\\'horloge locale d\\\'ordinateurs sur une référence d\\\'heure.\r\n\r\nLa première version v0 de NTP, formalisée dans la RFC 958, date de septembre 1985. Dès le début, ce protocole fut conçu pour offrir une précision de synchronisation meilleure que la seconde. Par rapport au service « Time Protocol » qui offre un service d\\\'heure sans proposer une infrastructure, le projet NTP propose une solution globale et universelle de synchronisation qui est utilisable dans le monde entier.'),(49,'2.0.1','en','Simple Mail Transfer Protocol (SMTP) is an Internet standard for electronic mail (email) transmission. First defined by RFC 821 in 1982, it was last updated in 2008 with the Extended SMTP additions by RFC 5321—which is the protocol in widespread use today.\r\nSMTP by default uses TCP port 25. The protocol for mail submission is the same, but uses port 587. SMTP connections secured by SSL, known as SMTPS, default to port 465 (nonstandard, but sometimes used for legacy reasons).'),(49,'2.0.1','fr','Simple Mail Transfer Protocol (SMTP, littéralement « protocole simple de transfert de courrier ») est un protocole de communication utilisé pour transférer le courrier électronique (courriel) vers les serveurs de messagerie électronique.\r\nSMTP est un protocole assez simple (comme son nom l\\\'indique). On commence par spécifier l\\\'expéditeur du message, puis le ou les destinataires d\\\'un message, puis, en général après avoir vérifié leur existence, le corps du message est transféré. Il est possible de tester un serveur SMTP en utilisant la commande telnet sur le port 25 d\\\'un serveur distant.'),(50,'2.0.1','en','In cryptography, X.509 is an important standard for a public key infrastructure (PKI) to manage digital certificates and public-key encryption and a key part of the Transport Layer Security protocol used to secure web and email communication.'),(50,'2.0.1','fr','X.509 est une norme de cryptographie de l\\\'Union internationale des télécommunications pour les infrastructures à clés publiques (PKI). X.509 établit entre autres un format standard de certificat électronique et un algorithme pour la validation de chemin de certification.\r\nX.509 a été créé en 1988 dans le cadre de la norme X.500. Il repose sur un système hiérarchique d\\\'autorités de certification, à l\\\'inverse des réseaux de confiance (comme PGP), où n\\\'importe qui peut signer les certificats des autres.'),(51,'2.0.1','en','Selenium is a portable software testing framework for web applications. Selenium provides a record/playback tool for authoring tests without learning a test scripting language (Selenium IDE). It also provides a test domain-specific language (Selenese) to write tests in a number of popular programming languages, including Java, C#, Groovy, Perl, PHP, Python and Ruby. The tests can then be run against most modern web browsers. Selenium deploys on Windows, Linux, and Macintosh platforms. It is open-source software, released under the Apache 2.0 license, and can be downloaded and used without charge.'),(51,'2.0.1','fr','Selenium est un framework de test informatique développé en Java.\r\nIl est associé à Selenium IDE, extension Firefox, pour l\\\'utiliser.'),(52,'2.1.1','en','Asterisk is a software implementation of a telephone private branch exchange (PBX); it allows attached telephones to make calls to one another, and to connect to other telephone services, such as the public switched telephone network (PSTN) and Voice over Internet Protocol (VoIP) services. Its name comes from the asterisk symbol, *.\r\nAsterisk is released with a dual license model, using the GNU General Public License (GPL) as a free software license and a proprietary software license to permit licensees to distribute proprietary, unpublished system components.'),(52,'2.1.1','fr','Asterisk est un autocommutateur téléphonique privé (PABX) open source et propriétaire (publié sous licence GPL et licence propriétaire) pour systèmes GNU/Linux. Il permet, entre autres, la messagerie vocale, les files d\\\'attente, les agents d\\\'appels, les musiques d\\\'attente et les mises en garde d\\\'appels, la distribution des appels. Il est possible également d\\\'ajouter l\\\'utilisation des conférences par le biais de l\\\'installation de modules supplémentaires et la recompilation des binaires.'),(53,'2.0.1','en','desc'),(53,'2.0.1','fr','XiVO est un logiciel libre (distribué sous licence GNU GPLv3) d\\\'autocommutateur téléphonique privé (PBX) ou IPBX. XiVO utilise le logiciel libre Asterisk'),(54,'2.0.1','en','Oracle WebLogic Server is a Java EE application server currently developed by Oracle Corporation. Oracle acquired WebLogic Server when it purchased BEA Systems in 2008.'),(54,'2.0.1','fr','Propriété de Oracle Corporation, Oracle WebLogic consiste en une famille de produits sur la plate-forme Java EE (auparavant J2EE) incluant :\r\nun serveur d\\\'applications J2EE, WebLogic Application Server\r\nun portail, WebLogic Portal\r\nune plate-forme Enterprise Application Integration\r\nun serveur transactionnel, WebLogic Tuxedo\r\nune plate-forme de télécommunications, WebLogic Communication Platform\r\nun serveur web HTTP'),(55,'2.1.1','en','description 1'),(55,'2.1.1','fr',''),(56,'2.0.1','en','description 1'),(56,'2.0.1','fr',''),(57,'2.0.1','en','description 1'),(57,'2.0.1','fr',''),(57,'2.0.2','en','description 1'),(57,'2.0.2','fr',''),(59,'1.3.3','en','English'),(59,'1.3.3','fr','Français'),(60,'1.0.1','en','description 1'),(60,'1.0.1','fr',''),(61,'2.0.1','en','description 1'),(61,'2.0.1','fr',''),(62,'2.0.1','en','description 1'),(62,'2.0.1','fr',''),(63,'2.0.1','en','description 1'),(63,'2.0.1','fr',''),(64,'2.0.1','en','description 1'),(64,'2.0.1','fr',''),(65,'2.2.1','en','description 1'),(65,'2.2.1','fr',''),(66,'2.0.1','en','description 1'),(66,'2.0.1','fr',''),(67,'2.0.2','en','description 1'),(67,'2.0.2','fr',''),(68,'2.1.1','en','description 1'),(68,'2.1.1','fr',''),(69,'2.1.1','en','description 1'),(69,'2.1.1','fr',''),(70,'2.2.1','en','description 1'),(70,'2.2.1','fr','');
